import styled from "styled-components";


export const Container = styled.main`
 width:100%;
 display:grid;
 grid-template-columns: repeat(auto-fit, minmax( 186px, 1fr));
 gap: 30px;padding: 2%;
 background-color: #EEE8AA;
`
